import React, { useEffect } from 'react';
import {
  Avatar,
  Box,
  Button,
  Card,
  CardHeader,
  IconButton,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Chip,
} from '@mui/material';
import CreateIcon from '@mui/icons-material/Create';
import { Delete } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { deleteFoodAction, getMenuItemsByRestaurantId, updateMenuItemsAvailability } from '../../componet/State/Menu/Action';
import { getProductRestaurantId } from '../../componet/State/Product/Action';

export default function ProductTable() {
  const dispatch = useDispatch();
  const jwt = localStorage.getItem("jwt");
  const { restaurant, category, product } = useSelector((store) => store);
  const navigate = useNavigate();

  useEffect(() => {
    dispatch(getProductRestaurantId({
      jwt,
      restaurantId: restaurant.usersRestaurant.id,
    }));
  }, [dispatch, jwt, restaurant.usersRestaurant.id]);

  return (
    <Box>
      <Card className='mt-1'>
        <CardHeader
          action={
            <IconButton onClick={() => navigate("/admin/restaurants/add-menu")} aria-label="settings">
              <CreateIcon />
            </IconButton>
          }
          title={"Menu"}
          sx={{ pt: 2, alignItems: "center" }}
        />
        <TableContainer component={Paper}>
          <Table sx={{ minWidth: 650 }} aria-label="simple table">
            <TableHead>
              <TableRow>
                <TableCell align="left">Ảnh</TableCell>
                <TableCell align="right">Tên món ăn</TableCell>
                <TableCell align="right">Danh mục cha</TableCell>
                <TableCell align="right">Danh mục con</TableCell>
                <TableCell align="right">Giá</TableCell>
                <TableCell align="right">Trạng thái</TableCell>
                <TableCell align="right">Xóa</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {product.products.map((item) => (
                <TableRow key={item.id} sx={{ '&:last-child td, &:last-child th': { border: 0 } }}>
                  <TableCell component="th" scope="row">
                    <Avatar src={item.images[0]}></Avatar>
                  </TableCell>
                  <TableCell align="right">{item.name}</TableCell>
                  <TableCell align="right">
                    {item.category ? item.category.name : 'N/A'}
                  </TableCell>
                  <TableCell align="right">
                    {item.categoryItems && item.categoryItems.length > 0 ? (
                      item.categoryItems.map((ingredient) => (
                        <Chip key={ingredient.id} label={ingredient.name}></Chip>
                      ))
                    ) : 'N/A'}
                  </TableCell>
                  <TableCell align="right">{item.price} VND</TableCell>
                  <TableCell align="right">
                    <Button
                      variant="contained"
                      style={{ backgroundColor: item.available ? 'green' : 'red' }}
                    >
                      {item.available ? "Còn Hàng" : "Hết Hàng"}
                    </Button>
                  </TableCell>
                  <TableCell align="right">
                    <IconButton color="primary">
                      <Delete />
                    </IconButton>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Card>
    </Box>
  );
}
